import React from 'react'
import styled from 'styled-components';

class CurrentDay extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      day: ""
    }
  }

  render() {
    return(
      <div>
        <h2> Dag {this.state.day} </h2>
      </div>
    )
  }
}


export default CurrentDay;
